import React from "react";
import ReactDOM from "react-dom/client";

const x = 10;
let text = "Goodbye";
if (x < 10) {
  text = "Hello";
}

const myelement = <h1>{text}</h1>;

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(myelement);
